searchIndex['regex'] = {"items":[[0,"","regex","This crate provides a native implementation of regular expressions that is\nheavily based on RE2 both in syntax and in implementation. Notably,\nbackreferences and arbitrary lookahead/lookbehind assertions are not\nprovided. In return, regular expression searching provided by this package\nhas excellent worst case performance. The specific syntax supported is\ndocumented further down."],[1,"Error","","Error corresponds to something that can go wrong while parsing\na regular expression."],[11,"pos","","The *approximate* character index of where the error occurred.",0],[11,"msg","","A message describing the error.",0],[1,"Regex","","Regex is a compiled regular expression, represented as either a sequence\nof bytecode instructions (dynamic) or as a specialized Rust function\n(native). It can be used to search, split\nor replace text. All searching is done with an implicit `.*?` at the\nbeginning and end of an expression. To force an expression to match the\nwhole string (or a prefix or a suffix), you must use an anchor like `^` or\n`$` (or `\\A` and `\\z`)."],[11,"original","","The representation of `Regex` is exported to support the `regex!`\nsyntax extension. Do not rely on it.",1],[11,"names","","",1],[11,"p","","",1],[1,"Captures","","Captures represents a group of captured strings for a single match."],[11,"text","","",2],[11,"locs","","",2],[11,"named","","",2],[1,"SubCaptures","","An iterator over capture groups for a particular match of a regular\nexpression."],[11,"idx","","",3],[11,"caps","","",3],[1,"SubCapturesPos","","An iterator over capture group positions for a particular match of a\nregular expression."],[11,"idx","","",4],[11,"caps","","",4],[1,"FindCaptures","","An iterator that yields all non-overlapping capture groups matching a\nparticular regular expression. The iterator stops when no more matches can\nbe found."],[11,"re","","",5],[11,"search","","",5],[11,"last_match","","",5],[11,"last_end","","",5],[1,"FindMatches","","An iterator over all non-overlapping matches for a particular string."],[11,"re","","",6],[11,"search","","",6],[11,"last_match","","",6],[11,"last_end","","",6],[1,"NoExpand","","NoExpand indicates literal string replacement."],[1,"RegexSplits","","Yields all substrings delimited by a regular expression match."],[11,"finder","","",7],[11,"last","","",7],[1,"RegexSplitsN","","Yields at most `N` substrings delimited by a regular expression match."],[11,"splits","","",8],[11,"cur","","",8],[11,"limit","","",8],[3,"quote","","Escapes all regular expression meta characters in `text` so that it may be\nsafely used in a regular expression as a literal string."],[3,"is_match","","Tests if the given regular expression matches somewhere in the text given."],[6,"Replacer","","Replacer describes types that can be used to replace matches in a string."],[9,"reg_replace","","Returns a possibly owned string that is used to replace the match\ncorresponding the the `caps` capture group.",9]],"paths":[[1,"Error"],[1,"Regex"],[1,"Captures"],[1,"SubCaptures"],[1,"SubCapturesPos"],[1,"FindCaptures"],[1,"FindMatches"],[1,"RegexSplits"],[1,"RegexSplitsN"],[6,"Replacer"]]};

searchIndex['fmt_macros'] = {"items":[[0,"","fmt_macros","Macro support for format strings"],[1,"Argument","","Representation of an argument specification."],[11,"position","","Where to find this argument",0],[11,"format","","How to format the argument",0],[11,"method","","If not `None`, what method to invoke on the argument",0],[1,"FormatSpec","","Specification for the formatting of an argument in the format string."],[11,"fill","","Optionally specified character to fill alignment with",1],[11,"align","","Optionally specified alignment",1],[11,"flags","","Packed version of various flags provided",1],[11,"precision","","The integer precision to use",1],[11,"width","","The string width requested for the resulting format",1],[11,"ty","","The descriptor string representing the name of the format desired for\nthis argument, this can be empty or any number of characters, although\nit is required to be one word.",1],[1,"PluralArm","","Structure representing one \"arm\" of the `plural` function."],[11,"selector","","A selector can either be specified by a keyword or with an integer\nliteral.",2],[11,"result","","Array of pieces which are the format of this arm",2],[1,"SelectArm","","Structure representing one \"arm\" of the `select` function."],[11,"selector","","String selector which guards this arm",3],[11,"result","","Array of pieces which are the format of this arm",3],[1,"Parser","","The parser structure for interpreting the input format string. This is\nmodelled as an iterator over `Piece` structures to form a stream of tokens\nbeing output."],[11,"input","","",4],[11,"cur","","",4],[11,"depth","","",4],[11,"errors","","Error messages accumulated during parsing",4],[2,"Piece","","A piece is a portion of the format string which represents the next part\nto emit. These are emitted as a stream by the `Parser` class."],[12,"String","","A literal string which should directly be emitted",5],[12,"CurrentArgument","","A back-reference to whatever the current argument is. This is used\ninside of a method call to refer back to the original argument.",5],[12,"Argument","","This describes that formatting should process the next argument (as\nspecified inside) for emission.",5],[2,"Position","","Enum describing where an argument for a format can be located."],[12,"ArgumentNext","","The argument will be in the next position. This is the default.",6],[12,"ArgumentIs","","The argument is located at a specific index.",6],[12,"ArgumentNamed","","The argument has a name.",6],[2,"Alignment","","Enum of alignments which are supported."],[12,"AlignLeft","","The value will be aligned to the left.",7],[12,"AlignRight","","The value will be aligned to the right.",7],[12,"AlignUnknown","","The value will take on a default alignment.",7],[2,"Flag","","Various flags which can be applied to format strings. The meaning of these\nflags is defined by the formatters themselves."],[12,"FlagSignPlus","","A `+` will be used to denote positive numbers.",8],[12,"FlagSignMinus","","A `-` will be used to denote negative numbers. This is the default.",8],[12,"FlagAlternate","","An alternate form will be used for the value. In the case of numbers,\nthis means that the number will be prefixed with the supplied string.",8],[12,"FlagSignAwareZeroPad","","For numbers, this means that the number will be padded with zeroes,\nand the sign (`+` or `-`) will precede them.",8],[2,"Count","","A count is used for the precision and width parameters of an integer, and\ncan reference either an argument or a literal integer."],[12,"CountIs","","The count is specified explicitly.",9],[12,"CountIsName","","The count is specified by the argument with the given name.",9],[12,"CountIsParam","","The count is specified by the argument at the given index.",9],[12,"CountIsNextParam","","The count is specified by the next parameter.",9],[12,"CountImplied","","The count is implied and cannot be explicitly specified.",9],[2,"Method","","Enum describing all of the possible methods which the formatting language\ncurrently supports."],[12,"Plural","","A plural method selects on an integer over a list of either integer or\nkeyword-defined clauses. The meaning of the keywords is defined by the\ncurrent locale.",10],[12,"Select","","A select method selects over a string. Each arm is a different string\nwhich can be selected for.",10],[2,"PluralSelector","","A selector for what pluralization a plural method should take"],[12,"Keyword","","One of the plural keywords should be used",11],[12,"Literal","","A literal pluralization should be used",11],[2,"PluralKeyword","","Enum of the 5 CLDR plural keywords. There is one more, \"other\", but that\nis specially placed in the `Plural` variant of `Method`."],[12,"Zero","","The plural form for zero objects.",12],[12,"One","","The plural form for one object.",12],[12,"Two","","The plural form for two objects.",12],[12,"Few","","The plural form for few objects.",12],[12,"Many","","The plural form for many objects.",12],[10,"new","","Creates a new parser for the given format string",4]],"paths":[[1,"Argument"],[1,"FormatSpec"],[1,"PluralArm"],[1,"SelectArm"],[1,"Parser"],[2,"Piece"],[2,"Position"],[2,"Alignment"],[2,"Flag"],[2,"Count"],[2,"Method"],[2,"PluralSelector"],[2,"PluralKeyword"]]};

